import React from 'react'
import { NavLink } from 'react-router-dom'

const Button = ({ filter, button }) => {
    return (
        <div>
            {
                button.map((b, i) => {
                    return (
                        <button 
                            key={i}
                            onClick={() => filter(b)}
                        >
                            {b}
                        </button>
                    )
                })
            }
        </div>
    )
}

export default Button
